import React from 'react'
import Common from './Common'
import imgcomp from "../image/computer.jpg"
const Home = () => {
  return (
    <div>
      <Common name="Welcome to My Page"
      btnName="Download My CV"
      link="/"
      imgsrc={imgcomp}
      ></Common>
    </div>
  )
}

export default Home
